import React from "react";
import ReactDOM from "react-dom";
// import "./index.css";
// import App from "./App";
// import { Add, Divide, Mod, Mul, Sub } from "./Clc";

function Card() {
  return <>
    <div className="cards">
      <div className="card">
        <img
          src=""
          alt="thumbnail"
          className="card-img"
        />
        <div className="card_info">
          <span className="card-category">A Netflix Orignal Series</span>
          <h3 className="card-title"></h3>
          <a href="https://www.netflix.com/in/" target="_blank">
            <button>Watch now</button>
          </a>
        </div>
      </div>
    </div>
  </>;
}

ReactDOM.render(
  <>
     <Card imgsrc="https://upload.wikimedia.org/wikipedia/commons/3/38/Stranger_Things_logo.png"/> <Card />
  </>,
  document.getElementById("root")
);
